// App.js
import React, { useState } from 'react';
import NotesList from './Not';

const App = () => {
  const [notes, setNotes] = useState([
    { id: 1, title: 'Notatka 1', description: 'Opis notatki 1' },
    { id: 2, title: 'Notatka 2', description: 'Opis notatki 2' },
    { id: 3, title: 'Notatka 3', description: 'Opis notatki 3' },
  ]);

  const editNote = (id) => {
    console.log('Edytuj notatkę o ID:', id);
  };

  const deleteNote = (id) => {
    setNotes(notes.filter(note => note.id !== id));
  };

  return (
    <div className="container mx-auto p-8">
      <h1 className="text-3xl font-bold mb-8">Moje Notatki</h1>
      <NotesList notes={notes} onEdit={editNote} onDelete={deleteNote} />
    </div>
  );
};

export default App;
